import React from "react";
import "./navbar.css";
import logo from "./logo1.png";

export default class Navbar extends React.Component {

    componentDidMount() {
        const Ulkitscript1 = document.createElement("script");
        Ulkitscript1.src = "https://cdn.jsdelivr.net/npm/uikit@3.10.1/dist/js/uikit.min.js";
        Ulkitscript1.async = true;

        const Ulkitscript2 = document.createElement("script");
        Ulkitscript2.src = "https://cdn.jsdelivr.net/npm/uikit@3.10.1/dist/js/uikit-icons.min.js";
        Ulkitscript2.async = true;

        document.body.appendChild(Ulkitscript1);
        document.body.appendChild(Ulkitscript2);

    }

    render() {

        return (
            <section id="nav-section">

                <div uk-sticky="sel-target: .uk-navbar-container; cls-active: uk-navbar-sticky; bottom: #transparent-sticky-navbar">
                    <div id="uk-top">

                        <div className="uk-card nav-card uk-card-body uk-width-1-2@m">
                            <h3 className="uk-card-title">  <a id="brand" href="/"> <img alt="" src={logo} /> Sweetcups Bangalore </a> </h3>
                            <div className="uk-child-width-expand@s uk-text-center nav-link-section" uk-grid='true'>
                                <div className="button-div">
                                    <button className="uk-button nav-button"> About </button>
                                </div>
                                <div className="button-div">
                                    <button className="uk-button nav-button"> Gallery </button>
                                </div>
                                <div className="button-div">
                                    <button className="uk-button nav-button"> Contact </button>
                                </div>
                                <div className="button-div">
                                    <button className="uk-button nav-button"> Services </button>
                                </div>
                            </div>

                            <div class="uk-card uk-card-vr uk-card-body uk-width-1-2@m">
                                <img alt="" src="https://img.icons8.com/office/50/000000/virtual-reality.png"/>
                                <h3 class="uk-card-title" style={{"marginTop":"10px"}}> Wanna See Us? </h3>
                                <p> Click here to view us through Virtual Reality! </p>
                            </div>

                        </div>


                    </div>
                </div>

            </section>
        )

    }

};
